MathJax.Localization.addTranslation("br","FontWarnings",{version:"2.7.9",isLoaded:!0,strings:{webFont:"MathJax a implij ar fonto\xF9 web evit diskwel ar jedado\xF9 war ar bajenn-ma\xF1. Pell eo ar re-se o pellgarga\xF1 ha diskwelet e vefe buanoc'h ma stailhfec'h fonto\xF9 jedoniezh war-eeun e teuliad fonto\xF9 ho reizhiad.",noFonts:"N'hall ket MathJax lec'hia\xF1 ur polis evit diskwel e jedado\xF9, ha dihegerz eo ar fonto\xF9 skeudenn. Ret eo implijout arouezenno\xF9 Unicode neuze. Emicha\xF1s e c'hallo ho merdeer diskwel anezho. Ne c'hallo ket arouezenno\xF9 zo beza\xF1 diskwelet mat, tamm ebet zoken.",webFonts:"GAnt an darn vrasa\xF1 eus ar merdeerio\xF9 arnevez e c'haller pellgarga\xF1 fonto\xF9 adalek ar web. Hizivaat ho merdeer (pe che\xF1ch merdeer) a c'hallfe gwellaat kalite ar jedado\xF9 war ar bajenn-ma\xF1.",fonts:"Gallout a ra MathJax implijout pe ar fonto\xF9 [STIX](%1) pe ar fonto\xF9 [MathJax TeX](%2); Pellgargit ha stailhit unan eus fonto\xF9-se evit gwellaat ho skiant-prenet gant MathJax.",STIXPage:"Krouet eo bet ar bajenn-ma\xF1 evit implijout ar fonto\xF9 [STIX ](%1). Pellgargit ha stailhit ar fonto\xF9-se evit gwellaat ho skiant-penet gant MathJax.",TeXPage:"Krouet eo bet ar bajenn-ma\xF1 evit implijout ar fonto\xF9 [MathJax TeX](%1). Pellgargit ha stailhit ar fonto\xF9-se evit gwellaat ho skiant-prenet gant MathJax.",imageFonts:"Ober a ra MathJax gant skeudenno\xF9 font kentoc'h eget gant fonto\xF9 web pe fonto\xF9 lec'hel. Gant se e teu an trao\xF9 gorrekoc'h war-wel ha marteze ne vo ket ar jedado\xF9 evit beza\xF1 moullet diouzh pizhder kloka\xF1 ho moullerez."}}),MathJax.Ajax.loadComplete("[MathJax]/localization/br/FontWarnings.js");
